De film gaat over een dag in het leven van twee broers. De ene, Jeff (Segel), is een loser die nog thuis bij zijn moeder (Sarandon) woont, de andere, Pat (Helms), zit in een midlifecrisis en denkt dat zijn vrouw Linda (Greer) een affaire heeft. Wanneer ze eropuit trekken om Linda te bespioneren, brengt dit allerlei onbedoelde gevolgen met zich mee.



